          <h2>Movies</h2>
          <p>Shop Now</p>
        </div>
      </div>
      <div className="category-container">
        {/* img */}
        <div className="category-body-container">
          <h2>Clothes</h2>
          <p>Shop Now</p>
        </div>
      </div>
      <div className="category-container">
        {/* img */}
        <div className="category-body-container">
          <h2>Accessories</h2>
          <p>Shop Now</p>
        </div>
      </div>

    </div>
  );
}

export default App;
